import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const Link = props => {
    var text;
    if(props.text) {
        text = props.text;
    } else {
        text = props.url;
    }
    return (
        <Col sm="4">
        <Card bg="warning" key="1" text="black" style={{ width: '18rem' }} className="">
            <Card.Body>
                <Card.Link href={props.url}>{text}</Card.Link>
            </Card.Body>
        </Card></Col>)
}

export default Link;
